import React, { ReactNode } from 'react';
import styled from 'styled-components';
import { useInput } from '@swyx/hooks';

interface MyProps {
  /** label of the input
   * @default ''
   * */
  label?: string;
  fieldName?: string;
  placeholder?: string;
  onChange?: Function;
  children?: ReactNode;
}

const Styled = styled.label`
  padding: 10px;
  display: block;
  border: 1px solid blue;
`;
/**
 * Filter field
 */
export default function TextField(props: MyProps) {
  const { fieldName, label = '', placeholder, onChange, children } = props;

  return (
    <Styled>
      {label}
      {fieldName && fieldName + ' :'}
      <input {...useInput('', onChange)} placeholder={placeholder} />
      {children}
    </Styled>
  );
}
